import React, { Component} from 'react';
import tasks from '../sample/tasks.json';

console.log(tasks);


export default class Task extends Component{

    state={
        tareas: tasks
    }

    render(){
        return (

            <div>
                {this.state.tareas.map( item => <h1>{item.id}</h1>)}
            </div>
        )}

}
